import {
  BrowserRouter, 
  Routes,
  Route
  } from 'react-router-dom';
// import './App.css';

import LoginPage from './pages/LoginPage'


function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" component={LoginPage}/>
        {/* <Route exact path="/dashboard" component={Dashboard}/> */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
